import React, { useEffect, useState } from "react";
import axios from "axios";
import { PieChart, Pie, Cell, Tooltip, Legend } from "recharts";

const LogAnalyzer = () => {
  const [logs, setLogs] = useState([]);
  const [sqlInjectionLogs, setSqlInjectionLogs] = useState([]);
  const [unauthorizedAccessLogs, setUnauthorizedAccessLogs] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:5000/api/logs")
      .then((response) => {
        console.log("📥 Fetched Logs:", response.data); // Debugging
        setLogs(response.data);
        filterLogs(response.data);
      })
      .catch((error) => console.error("❌ Error fetching logs:", error));
  }, []);

  const filterLogs = (logs) => {
    console.log("🔎 Raw Logs:", logs);

    logs.forEach((log, index) => {
      console.log(`🔍 Log ${index + 1} - flagged:`, log.flagged, "IP:", log.ipAddress);
    });

    const flaggedLogs = logs.filter((log) => log.flagged === true);

    setSqlInjectionLogs(flaggedLogs);
    setUnauthorizedAccessLogs(flaggedLogs);
  };

  const pieData = [
    { name: "SQL Injection", value: sqlInjectionLogs.length },
    { name: "Unauthorized Access", value: unauthorizedAccessLogs.length },
  ];

  const COLORS = ["#0088FE", "#FF8042"];

  return (
    <div className="container">
      <h1>Log Analyzer Dashboard</h1>

      <div className="chart-container">
        <PieChart width={400} height={400}>
          <Pie
            data={pieData}
            cx="50%"
            cy="50%"
            outerRadius={150}
            fill="#8884d8"
            dataKey="value"
            label
          >
            {pieData.map((entry, index) => (
              <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
            ))}
          </Pie>
          <Tooltip />
          <Legend />
        </PieChart>
      </div>

      {/* SQL Injection Logs */}
      <h2>🚨 SQL Injection Logs</h2>
      {sqlInjectionLogs.length === 0 ? (
        <p>⚠️ No SQL Injection logs found.</p>
      ) : (
        <table border="1">
          <thead>
            <tr>
              <th>IP Address</th>
              <th>Timestamp</th>
              <th>Flagged</th>
            </tr>
          </thead>
          <tbody>
            {sqlInjectionLogs.map((log, index) => (
              <tr key={index}>
                <td>{log.ipAddress || "Unknown IP"}</td>
                <td>{new Date(log.timestamp).toLocaleString()}</td>
                <td>{log.flagged ? "✅ Yes" : "❌ No"}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}

      {/* Unauthorized Access Logs */}
      <h2>🚫 Unauthorized Access Logs</h2>
      {unauthorizedAccessLogs.length === 0 ? (
        <p>⚠️ No Unauthorized Access logs found.</p>
      ) : (
        <table border="1">
          <thead>
            <tr>
              <th>IP Address</th>
              <th>Timestamp</th>
              <th>Flagged</th>
            </tr>
          </thead>
          <tbody>
            {unauthorizedAccessLogs.map((log, index) => (
              <tr key={index}>
                <td>{log.ipAddress || "Unknown IP"}</td>
                <td>{new Date(log.timestamp).toLocaleString()}</td>
                <td>{log.flagged ? "✅ Yes" : "❌ No"}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default LogAnalyzer;
